In every GTK application you write, you should start by setting up an event handler. By using an event-driven approach, you can eliminate the need for reference counters, and potentially getting trapped in complex cyclic reference disasters. We can achieve this using a channel, creating a future that handles events received from the channel, and attaching that future to GLib's default executor. GLib already has facilities for asynchronous programming built in, and GTK leverages this extensively in its design. We can also have our code spawned on GLib's default executor as well, to run alongside the asynchronous code in GTK. Whenever we program the signals in our widgets, we will attach the Sender to the connect_method(), pass an Event enum through that Sender, and then the Receiver in the event-handler will match that Event and do what we want to the application. use std::process; enum Event { Quit
} fn main() { glib::set_program_name("First GTK App".into()); glib::set_application_name("First GTK App"); // Initialize GTK before proceeding. if gtk::init().is_err() { eprintln!("failed to initialize GTK Application"); process::exit(1); } // Attach `tx` to our widgets, and `rx` to our event handler let (tx, rx) = async_channel::unbounded(); // Processes all application events received from signals let event_handler = async move { while let Ok(event) = rx.recv().await { match event { Event::Quit => { } } } }; // GLib has an executor in the background that will // asynchronously handle our events on this thread glib::MainContext::default().spawn_local(event_handler); // Thread will block here until the application is quit gtk::main();
}
